Which value should be returned by a apollo graphql mutation?<p>I'm using apollo graphql to call some mutation to change db data. I need some advice which value should be returned usually.</p>
<p>For <code>insertOne()</code> I would return the ID of the new document and for removing a dataset I would also return the ID, to remove the dataset on the client cache.</p>
<p>But what about <code>updateOne</code> - as it could be a very simple task as shown below, but sometimes it can do some complex update? I'm not quite sure which would be the most useful returning value.</p>
<p>In this simple example I'm just updating some content of a specific mongodb document. Right now the WriteResult of this method is returned. But is this really useful?</p>
<p>I see the follwing options:</p>
<ol>
<li>Returning writeResult object - which has the need to be defined in the backend</li>
<li>Check <em>writeResult</em> and return boolean, e.g. result.nModified &gt; 0</li>
<li>Return the content result - which would be at the end just the input content</li>
<li>Returning the updated document - which would need a <code>findOne({ _id: id })</code></li>
<li>Just returning <code>true</code>, which maybe is not very useful?!</li>
</ol>
<p>I know there is not a single solution for all use cases, but maybe someone could explain which way to go in general...</p>
<p><strong>server</strong></p>
<pre><code>async updateContent(id, name, value) {
  const Content = this.db.collection('content')
  return Content.updateOne(
    { _id: id },
    { $set: { [name]: value } }
  )
}
</code></pre>
<p><strong>client</strong></p>
<pre><code>updateContent({
  variables: { id, name, value }
})
  .then((response) =&gt; {
    // response.data.updateContent
  })
  .catch((error) =&gt; console.error(error))
</code></pre>
<p><strong>graphql</strong></p>
<pre><code>mutation updateContent($id: ID!, $name: String, $value: String) {
  updateContent(id: $id, name: $name, value: $value) {
    nModified
  }
}
</code></pre>
<p><strong>schema</strong></p>
<pre><code>type WriteResult {
  nModified: Int,
  nRemoved: Int,
  nInserted: Int,
  n: Int
  ok: Int
}

type Mutation {
  updateContent(id: ID!, name: String, value: String): ContentString
}
</code></pre>

