Subtract value in a document in API request Mongodb<p>Help guys im stuck. First of all im a beginner. This is my first react project</p>
<p>I have a form being sent with f_name, l_name, order
order is an array of orders
I am trying to loop through it and find the corresponding product then subtract the quantity for that order in the available stocks.</p>
<pre><code>
let Transaction = require(&quot;../models/transactionModel&quot;);
let Products = require(&quot;../models/userInventoryModel&quot;);

router.route(&quot;/add&quot;).post(async (req, res) =&gt; {
  const { f_name, l_name, order } = req.body;

  try {
    const newTransaction = new Transaction({
      f_name,
      l_name,
      order,
    });

    await order.forEach((order) =&gt; {
      let newProduct = Products.findOneAndUpdate(
        { product: order.product },
        { $inc: { stocks: -order.quantity } }
      );
      newProduct.save();
    });

    await newTransaction.save();
    res.status(200).json(newTransaction);
  } catch (error) {
    res.status(400).json(error.message);
  }
});
</code></pre>

