<pre class="lang-msql prettyprint-override"><code>Schema E = {
    _id,
    ... some fields,
    details: [
       {
          ...somefields,
          people: [ObjectIds] 
       }
    ]
}
</code></pre>
<p>First, I have an aggregate query where I am using <em>$geoNear then $match, and then $facet</em>.
After the operations the document that I get is as follows:</p>
<pre class="lang-msql prettyprint-override"><code>estates: [
    {
       _id,
       ... some fields,
       details: [
          {
             ...somefields,
             people: [ObjectIds]
          }
       ],
       ... other fields
    },
    ... more estate objects
]
],
page: [...some objects]
</code></pre>
<p>I have an array called <strong>approved</strong> which has some object Ids.</p>
<p>I want to filter the <strong>page</strong> array inside <strong>events.details</strong> while keeping the rest of the fields intact.</p>
<p>The result I want is as follows:</p>
<p><strong>NOTE</strong>: *The field <strong>filteredPeople</strong> is the array I want after filtering <strong>people</strong> with <strong>approved</strong>.</p>
<pre class="lang-msql prettyprint-override"><code>estate: [
    {
       _id,
       ... some fields,
       details: [
          {
             ...somefields,
             filteredPeople: [ObjectIds],
             numberOfPeople: Size of people array

          }
       ],
       ... other fields
    },
    ... more estate objectes
],
page: [...some objects]
</code></pre>
<p>This is what I tried doing:</p>
<pre class="lang-msql prettyprint-override"><code>{
  &quot;estates&quot;: {
  &quot;$map&quot;: {
    &quot;input&quot;: &quot;$estates&quot;,
    &quot;as&quot;: &quot;estate&quot;,
    &quot;in&quot;: {
      &quot;details&quot;: {
        &quot;$map&quot;: {
          &quot;input&quot;: &quot;$$estate.details&quot;,
