            &quot;filteredPeople&quot;: {
              &quot;$filter&quot;: {
                &quot;input&quot;: &quot;$$detail.people&quot;,
                &quot;as&quot;: &quot;people&quot;,
                &quot;cond&quot;: { &quot;$in&quot;: [&quot;$$people&quot;, approved] }
              }
            }
          }
        }
      }
    }
  }
  },
}

</code></pre>
<p>But this erases the other fields. The other way is to create a separate field called estatePeople where the result of the <code>$addFields</code> will be stored.</p>
<p>I could then try to merge the two arrays. But I don't have any field to match them as the second estatePoeple array will not have anything but the filteredPeople. So I will then somehow have to merge the two arrays just by the index of the array and where they appear.</p>
<p>Can someone please help me out on how to get the desired document with relatively good performance?</p>

