How to get a country region code for a given address<p>I let users to fill out a form where they state their city of residence. To simplify the process I use Mapbox geocoding API: user starts filling the name of his city and the API suggests results.</p>
<p><a href="https://i.stack.imgur.com/0f1yE.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/0f1yE.png" alt="User form" /></a></p>
<p>User selects a result and I store in my DB the data in following format:</p>
<pre><code>{
  &quot;city&quot;: &quot;Paris&quot;,
  &quot;region&quot;: &quot;TX, //Texas
  &quot;country&quot;: &quot;US&quot;
}
</code></pre>
<p>I have country svg maps divided by regions.</p>
<pre><code>&lt;svg&gt;
  &lt;g&gt;
    &lt;path id=&quot;US-AK&quot; title=&quot;Alaska&quot; d=&quot;...&quot; /&gt;
    &lt;path id=&quot;US-TX&quot; title=&quot;Texas&quot; d=&quot;...&quot; /&gt;
    ...
  &lt;/g&gt;
&lt;/svg&gt;
</code></pre>
<p>Now I'm able to select from the DB all users living in Texas and to show the information (number of users living in the region) on the svg map.</p>
<p>The problem is that the API does not always give me a region information in the response.
For example for <code>Paris, France</code></p>
<p>I've tested <a href="https://gist.github.com/pistom/a433c76f935ff7234d75480ade26c549" rel="nofollow noreferrer">6 different API</a> but the data they give me about regions is not consistent. Sometimes APIs don't contain any information about region. Sometimes the information is wrong.</p>
<p>I see only one solution: to store all data about regions (codes and names in different languages) and to let users select their country region by themselves.
